import { Button, Typography } from '@mui/material'
import FacebookIcon from '@mui/icons-material/Facebook';
import { fontSize } from '@mui/system';

function App() {
  return (
    <div className="App">
      <Typography
        align='center'
        variant="h1"
        sx={{
          background: 'red',
          color: 'white',
          fontSize: '12px'
        }}
      >
        h1. Heading
      </Typography>
      <Button endIcon={<FacebookIcon />} variant="outlined" color='secondary'>Text</Button>
    </div>
  );
}

export default App;
